import axios from "axios";

const GOOGLE_ID = process.env.REACT_APP_GOOGLE_ID;
const REDIRECT = process.env.REACT_APP_TOKEN_REDIRECT;
const TYPE = process.env.REACT_APP_OAUTH_TYPE;
const SCOPE = process.env.REACT_APP_SCOPE;
// const oAuthLogin = () => {
//     window.location.assign("https://accounts.google.com/o/oauth2/v2/auth?" +
//         `client_id=${GOOGLE_ID}&`+
//         `redirect_uri=${REDIRECT}&`+
//         `response_type=${TYPE}&`+
//         `scope=${SCOPE}`);
// };

const oAuthGoogleLogin = () => {
    axios.get("/oauth2/authorization/google").then((resp) => {
        console.log(resp);
    })
}

const oAuthKakaoLogin = () => {
    axios.get("/oauth2/authorization/kakao").then((resp) => {
        console.log(resp);
    })
}
export default function Home() {
    return (
        <main style={{ padding: "1rem 0" }}>
            <h2>Home</h2>
            <button onClick={oAuthGoogleLogin}>Google Login</button>
            <button onClick={oAuthKakaoLogin}>Kakao Login</button>
        </main>
    );
}
